angular.module('tracker.controllers', [])
.controller('TrackerCtrl', function($scope, $firebaseArray,TrackerService) {		  
		  
	  var ref = firebase.database().ref().child("trackedItems");

	  $scope.trackedItems = $firebaseArray(ref);  
	  
	  console.log($scope.trackedItems);	

		$scope.clickrem=function(trackedItem){
			$scope.trackedItems.$remove(trackedItem);
		}
	  
})


.controller('AddTrackedItemCtrl', function($scope, $state, TrackerService,  $ionicPlatform, $firebaseArray) {
	

	$scope.st= TrackerService.getstands();
	
	$scope.trackerMasterItem = {title : "", starts:"", ends:"", description:""};
	
	$scope.trackerItem = {title : "", starts:"", ends:"", description:"",date:new Date().getTime().toString()};
	
	var ref = firebase.database().ref().child("trackedItems");

	$scope.trackedItems = $firebaseArray(ref);
	
	
	$scope.addTrackerItem = function (form) {
		
		if (form.$valid) {		
			  
			$scope.trackedItems.$add(angular.copy($scope.trackerItem));
		
			$scope.trackerItem = angular.copy($scope.trackerMasterItem);			
							window.confirm("Data Saved");

			$state.go("tab.tracker")
			
		} else {
			
			console.log("TrackerCtrl::invalidForm");
			console.log(form.$error);
		}
	}
	
})


.controller('DetailCtrl',function ($scope, $stateParams, TrackerService,$firebaseObject,$firebaseArray,$cordovaGeolocation, $ionicPlatform) {
	
	$scope.id = $stateParams.trackerId;

 	$scope.item = $firebaseObject(firebase.database().ref().child("trackedItems").child($stateParams.trackerId));


	
  	$scope.$on('mapInitialized', function (event,map) {

        $scope.map = map;

    });


	$ionicPlatform.ready(function() {
	  var posOptions = {timeout: 10000, enableHighAccuracy: true};
	  $cordovaGeolocation.getCurrentPosition(posOptions)
	    .then(function(position) {
	    	$scope.coords = position.coords;
	    }, function(err) {
	    	console.log('getCurrentPosition error: ' + angular.toJson(err));
	    });
	});
  	

})
